function App() {
  return (
    <>

      <Router>




        <Routes>
          <Route path='/' element={<AdminLayout />} />
          <Route path="/add" element={<AdminLayout>

            <AddCategory />

          </AdminLayout>} />

        </Routes>




      </Router></>




  );
}

export default App;
